export default function Home() {
  return (
    <main className="bg-very-dark-blue max-w-6xl px-6 h-full">
      <div className="flex justify-between">
        <input className="bg-dark-blue px-6 py-2" placeholder="Search for a country..." />
        <select className="bg-dark-blue text-sm px-6 py-6">
            <option value="">Filter by Region</option>
            <option value="test1">Test1</option>
            <option value="test2">Test2</option>
        </select>
      </div>
    </main>
  );
}
